import { connect } from 'react-redux';
import { Field, reduxForm } from 'redux-form';

class Contact extends React.Component {
  render() {
      return (
      <div>
          <h1 className="cover-heading">Contact</h1>
      </div>
    )
  }
}

export default connect()(Contact);
